; Day 1 / #1 =====================================================================================================================

;; converts the string of calories to an array with all calories values per elf.
(defn get-calories [input]
  (for [elf (str/split input #"\n\n")]
    (apply +
      (for [cal (str/split-lines elf)]
        (Integer/parseInt cal)))))

;; returns the highest calorie count.
(defn get-highest-calories [input]
  (apply max (get-calories input)))

